import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CurrencyRate = () => {

  const [currencyData, setCurrencyData] = useState({});

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/AllCurrency')
      .then((response) => {
        setCurrencyData(response.data.data);
      })
      .catch((error) => {
        console.error('Error fetching data: ', error);
      });
  }, []);

  const tr=Object.keys(currencyData).map((currencyCode) => (
    <tr key={currencyCode}>
    <td>{currencyData[currencyCode].code}</td>
    <td>{currencyData[currencyCode].value}</td>
   </tr>
    ))
  return (
    <div style={{display:'flex',alignItems:'center' ,justifyContent:'center' ,marginTop:'25px'}}>
      <table dir='rtl' style={{width:'75%',height:'75%',position: 'relative'}}>
        <thead>
          <tr>
            <th>Currency Code</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
            {tr}
      </tbody>
      </table>
    </div>
  )
}

export default CurrencyRate
